Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE1','Made on requested date','Your appointment was booked based upon your request for an appointment on %s %s.  Please use the Appointments feature on the previous screen to see more information on this and other appointments booked at VA healthcare facilities.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE2','Alternative date after calling Veteran','Based upon a telephone call with you, an appointment has been booked at a time other than your original request. Please use the Appointments feature on the previous screen to see more information on this and other appointments at VA healthcare facilities.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE3','Unable to meet request, First Attempt','We were unable to book you an appointment at the times or with the provider requested.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE4','Not booked, unable to contact Veteran','We were unable to contact you at the phone number provided to discuss your appointment.  We apologize for not being able to book this second request for an appointment.  You can call the facility to discuss scheduling options for your current need or you can start a new appointment request using this application.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE5','Cancelled by Clinic','Regrettably, the clinic had to cancel your appointment.  You can either call the facility to reschedule or you can make a new appointment request through this app.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE6','Cancelled at Veteran Request','Based upon your request during a telephone call, this appointment has been cancelled.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE7','Cancelled by Veteran - VA Confirmed','This message confirms that VA has received your request to cancel the appointment that was previously booked.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE8','Cancelled by Veteran - Pending','Your request to cancel this appointment has been sent.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE9','Unable to meet request, First Attempt','This request is no longer active.  The new request has been added to your list. Please check that request for further updates.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE10','Type of Visit changed to Telephone Visit','Your request for a Video Conference was changed to a Telephone Visit. Either the facility or provider requested currently are not providing Video Conference appointments.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE11','Type of Visit changed to Telephone Visit. Booked on alternate date after telephone conversation.','Your request for a Video Conference was changed to a Telephone Visit.  Either the facility or provider requested currently are not providing Video Conference appointments. Based upon a telephone call with you, an appointment has been booked at a time other than your original request. Please use the Appointments feature on the previous screen to see more information on this and other appointments at VA healthcare facilities.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE12','Booked on alternate date.','Your appointment has been booked at a time that differs from what you originally requested. Please use the VA Appointments app to see more information on this and other appointments at VA healthcare facilities.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE13','Type of Visit changed to Telephone Visit. Booked on alternate date.   ','Your request for a Video Conference was changed to a Telephone Visit. The facility requested is not currently providing Video Conference appointments for the Type of Care you selected. Also, your appointment has been booked at a time that differs from what you originally requested. Please use the VA appointments app to see more information on this and other appointments at VA healthcare facilities.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE14','Cancelled at Veteran Request','Based upon your request during a office visit, this appointment request has been cancelled.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE15','Scheduled in Community on requested date.','Your Community appointment was scheduled based upon your request.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE16','Scheduled in Community on alternate date.','Your Community appointment has been scheduled at a time that differs from what you originally requested. Please log in to VA Appointments to review your appointment dates and times.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE17','Cancelled at Veteran request','Your appointment request has been cancelled at your request.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE18','Cancelled by VA - Not Eligible for Community Care','Your request for a Community appointment has been cancelled because you did not meet eligibility requirements.');
Insert into VARDB.DETAIL_CODE (DETAIL_CODE_ID,PROVIDER_MESSAGE,VETERAN_MESSAGE) values ('DETCODE19','Cancelled by VA - Unable to meet request','Your request for an appointment has been cancelled because we have been unable to contact you to complete the request.');
